import consumer from "./consumer"

consumer.subscriptions.create("RoomChannel", {
  connected() {
    // Called when the subscription is ready for use on the server
    console.log("connected to the room......")
  },

  disconnected() {
    // Called when the subscription has been terminated by the server
    console.log("disconnected.......")
  },

  received(data) {
    // Called when there's incoming data on the websocket for this channel
    console.log("receiving dataaaaaa", data);
    console.log("dataaaaaaaa", JSON.parse(data.content));
    var x = $('#container');
    console.log("xxxxxxxxxxx", x);

    var toAdd = document.createDocumentFragment();

    var headers = Object.keys(data.content[0]);
    for(var i = 0; i < data.content.length; i++) {
      var tr = document.createElement('tr');

        for(var j = 0; j < headers.length; j++) {
          console.log("jjjjjjj", headers[j]);
          var td = document.createElement('td');
          td.appendChild(document.createTextNode(data.content[headers[j]]));
          tr.appendChild(td)
        }

          $('#container').appendChild(tr);
    }
}
})
